import * as React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import {FC} from "react";
import {BoxTeam} from "./BoxTeam";
import {BoxMetric} from "./BoxMetric";
import {BoxRelease} from "./BoxRelease";
import {BoxComponent} from "./BoxComponent";

interface BoxProps {
    title: string;
    description: string;
    type: string;
    id: string;
}

export const Box: FC<BoxProps> = ({title, description, id, type}) => {
    switch (type) {
        case 'team': return BoxTeam
        case 'metric': return BoxMetric
        case 'release': return BoxRelease
        case 'component': return BoxComponent
        default: return null
    }

};
